import React from 'react'
import Card from './Card'
export default function Categories(props) {
  return (
    <div>
    <h3>Categories</h3>
    {
        props.categories.map((element)=>{
            return <Card {...element}></Card>
        })
    }
    <button>Add Categories</button>
    </div>
  )
}
